import {
  LinkWrapper,
  SocialMediaWrapper,
  Link,
} from "../../StyledComponents/socialMediaItems";

const SocialMedia = ({iconSize, colorPattern}) => (
  <SocialMediaWrapper>
    <LinkWrapper>
      <Link pattern={colorPattern}>
        <FontAwesomeIcon icon={faTwitter} size="2x" />
      </Link>
    </LinkWrapper>
    <LinkWrapper>
    <Link>
    <FontAwesomeIcon icon={faFacebook} size="2x" />
    </Link>
    </LinkWrapper>
    <LinkWrapper>
    <Link>

    </Link>
    </LinkWrapper>
  </SocialMediaWrapper>
);

export default SocialMedia;
